import React from "react";
import styles from './Calendar.module.css';

const Calendar = props =>{

    return(
        <div clasName={styles.newtile}>
            <div className={styles.title}> Deadlines this Month</div>
            <div className={styles.cal}> calendar here</div>
        </div>
    );
}

export default Calendar;
